import React from 'react';
import './App.css';

function changeBackgroundColor(color) {
    document.body.style.background = color;
  }

function	App()
{
	return (
		<React.Fragment>
			<div className="App">
			<ul>
				<li onMouseOver={changeBackgroundColor('adff2f')}>TRANSCENDANCE</li>
				</ul>
			</div>
			<div className="Content">
				<h1>PLAY</h1>
			</div>
		</React.Fragment>
	);
}

export default App;
